// HasAnnotated applies the HasEdge predicate on the "annotated" edge.
func HasAnnotated() predicate.TaskLog {
	return predicate.TaskLog(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.To(AnnotatedTable, FieldID),
			sqlgraph.Edge(sqlgraph.O2M, false, AnnotatedTable, AnnotatedColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasAnnotatedWith applies the HasEdge predicate on the "annotated" edge with a given conditions (other predicates).
func HasAnnotatedWith(preds ...predicate.Annotation) predicate.TaskLog {
	return predicate.TaskLog(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.To(AnnotatedInverseTable, FieldID),
			sqlgraph.Edge(sqlgraph.O2M, false, AnnotatedTable, AnnotatedColumn),
		)
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.TaskLog) predicate.TaskLog {
	return predicate.TaskLog(func(s *sql.Selector) {
		s1 := s.Clone().SetP(nil)
		for _, p := range predicates {
			p(s1)
		}
		s.Where(s1.P())
	})
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.TaskLog) predicate.TaskLog {
	return predicate.TaskLog(func(s *sql.Selector) {
		s1 := s.Clone().SetP(nil)
		for i, p := range predicates {
			if i > 0 {
				s1.Or()
			}
			p(s1)
		}
		s.Where(s1.P())
	})
}

// Not applies the not operator on the given predicate.
func Not(p predicate.TaskLog) predicate.TaskLog {
	return predicate.TaskLog(func(s *sql.Selector) {
		p(s.Not())
	})
}
